import UsersList from '../components/UsersList';
import Layout from '../components/Layout';
const Users = ({url:{query:{name}}})=>(
    <Layout>
        <div>
            <h1>Users page</h1> <br/>
            <UsersList></UsersList>
        </div>
    </Layout>
)
export default Users;
